import React, { useState} from 'react';


const Test = () => {
    const [isOpen, setIsOpen] = useState(false)

    const toggle = () => {
        setIsOpen(!isOpen)
    }

    return (
        <>
            
         <h1>Trying to get images via Amazon S3</h1>
                        
        </>
    );
};

export default Test;
